import React from 'react'
import { useNavigate } from 'react-router-dom';

export default function RoomItem(props) {
  const navigate = useNavigate()

  const goToRoomNameComp =() => {
    navigate('/roomname')
  }

  return (
    <div className={`roomItem ${props.room.rColor}`}  onClick={goToRoomNameComp}>
      {props.room.rName}
    </div>
  )
}
